from typing import List
from collections import Counter

class Solution:
    def minOperations(self, nums: List[int], target: int) -> int:
        count = Counter(nums)
        ops = 0

        while True:
            if target in count and count[target] > 0:
                return ops
            if target % 2 == 1:
                if 1 in count and count[1] > 0:
                    count[1] -= 1
                    target -= 1
                else:
                    return -1
            else:
                if target // 2 in count and count[target // 2] > 0:
                    count[target // 2] -= 1
                    count[target] += 1
                    target //= 2
                    ops += 1
                elif 1 in count and count[1] > 0:
                    needed_ones = target - 2 ** (target.bit_length() - 1)
                    if count[1] >= needed_ones:
                        return ops + 1
                    return -1
                else:
                    return -1
